import {FETCH_DASHBOARD} from '../actions/types'
const INIT_STATE ={
    items:[],
    loading:false,
}

const DashboardReducer = (state = INIT_STATE, action) => {
    switch (action.type) {
      case FETCH_DASHBOARD:
        console.log('dashboard reducer')
        return {
          ...state,
          events: action.payload,
        }


      default:
        return state
    }
  }
  
  export default DashboardReducer
